import React, { useEffect, useState } from 'react'

export const Cities = (props) => {

    const [dynamiccity,setDynamicCity]=useState("city")
    const samecity = (e)=>{
        e.preventDefault();
        setDynamicCity(props.city);
        props.setCity(props.city);
    }

    return (
       <>
        <div className="city">

        <ul className="city-drop-link-group">
            <li>
            <a href="" onClick={samecity}>{props.city}</a>
            </li>
            </ul>
        </div>
       </>
    )
}
